import React from 'react';

class Increment extends React.Component {
  constructor(props) {
    super(props);
    this.state = { total: 0 };
  }


  render() {
    const { total } = this.state;
    return (
      <div>
        <h1>Qantidade</h1>
        <button type="button">-</button>
        {total}
        <button type="button">+</button>
      </div>
    );
  }
}

export default Increment;
